import React from "react";

import "./shop.scss";
import CollectionOverview from "../../components/collection-overview/collection-overview";

const ShopPage = ({ collections }) => (
  <div className="shop-page">
    <CollectionOverview/>
  </div>
);


export default ShopPage;
